function render(business, invoice, setting, user) {
    // console.log("******invoice ", invoice);
    // console.log("******setting ", setting);
    // console.log("******user ", user);
    // console.log("******business ", business);
    let data = getStart();
    data += getBody();
    data += getNotes();
    data += getUserFooter();
    data += getEnd();
    // data += getHeaderSection();
    // data += getLogoSection(setting, invoice);
    // data += getMessageSection(business, invoice);
    // data += getPaymentSection(invoice);
    // if (message)
    //     data += getUserMessageSection(message);
    // data += getRecurringSection();
    // data += getBusinessSection(business, invoice, user);
    // data += getFooterSection();
    // data += getMailEnd();
    if (shouldWriteHtml) {
        let outputFile = path.join(__dirname, "output.html");
        fs.writeFile(outputFile, data, (err) => {
            if (err) console.log(err);
            console.log("Successfully Written to File.");
        });
    }
    return { header: getHeaderSection(), body: data, footer: getFooter() };
}
